import React, { useEffect, useState } from "react";
import axios from "axios";

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = { resultado: {} };
  }
  changeHandler = (e) => {
    const el = e.target;
    this.setState({
      [el.name]: el.type === "file" ? el.files[0] : el.value,
    });
  };

  submitImg = (e) => {
    e.preventDefault();

    const bodyFormData = new FormData(e.target); // pass in the form

    /* esto funciona
     axios
      .post("http://127.0.0.1:8000/detectar-objeto", bodyFormData)
      .then((result) => {
        console.log("success", result.data);
         this.setState({ resultado: result.data });
        console.log(this.state.resultado);
      })
      .catch((error) => {
        console.log("la cagamos");
      });
      */
    const getAnswer = async () => {
      const { data } = await axios.post(
        "http://127.0.0.1:8000/detectar-objeto",
        bodyFormData
      );
      this.setState({ resultado: data.data });
    };
    useEffect(() => {
      getAnswer();
    }, []);
  };

  render() {
    return (
      <body>
        <h2>Detectar Objeto</h2>
        <form onSubmit={this.submitImg} encType="multipart/form-data">
          <input type="file" name="img1" />
          <button type="submit">Submit</button>
          <p>{this.state.resultado}</p>
        </form>
      </body>
    );
  }
}
export default Home;
